// lib
import { createUseStyles } from "react-jss";
import clsx from "clsx";
// import { useState } from "react";
// import axios from "axios";

import useForm from "../services/useForm";
import useColor from "../services/useColor";

const useStyles = createUseStyles({
  EditCollection: {
    top: "0",
    left: "0",
    width: "100vw",
    height: "100vh",
    display: "flex",
    justifyContent: "center",
    zIndex: "11",
    color: "#FFFFFF",
  },
  editCollection__bg: {
    backgroundColor: "#000",
    opacity: "70%",
  },
  editCollection__container: {
    width: "42rem",
    minWidth: "48rem",
    marginTop: "6rem",
    padding: "2rem",
    backgroundColor: "#1D1D27",
    textAlign: "left",
    borderRadius: "1.6rem",
  },
  editCollection__caption: {
    fontSize: "2rem",
    textTransform: "capitalize",
    fontWeight: "bold",
    marginBottom: "2rem",
  },
  editCollection__title: {
    fontSize: "1.6rem",
    textTransform: "capitalize",
    marginBottom: "1rem",
  },
  editCollection__colors: {
    display: "grid",
    gap: "1.5rem",
    gridTemplateColumns: "repeat(auto-fit, 6rem)",
  },
  editCollection__color: {
    width: "6rem",
    height: "5rem",
    backgroundColor: "transparent",
    cursor: "pointer",
    borderRadius: "1.2rem",
    transition: "all 0.1s ease-in-out",
    position: "relative",
  },
  editCollection__buttons: {
    gap: "1rem",
    marginTop: "5rem",
  },
  editCollection__group: {
    marginBottom: "2rem",
    width: "100%",
  },
  editCollection__err: {
    color: "red",
    padding: "1rem",
    fontSize: "1.4rem",
  },
});

const HandleEditTask = (values) => {
  console.log("This action is only designed for admin");
  console.log(values);

  // const name = values.name;
  // axios({
  //   method: "post",
  //   url: "api/categories/${collection.id}",
  //   data: { name },
  // })
  //   .then((res) => {
  //     console.log(res);
  //   })
  //   .catch((err) => {
  //     const errMsg = err.response.data.message;
  //     console.log(errMsg);
  //   });
};

const EditTask = ({task, toggleFunc, displayVal }) => {
  const classes = useStyles();

  const { handleChange, handleSubmit, values, errors } =
    useForm(HandleEditCollection);

  const closeTabFunc = () => (event) => {
    toggleFunc(false)();
  };

  return (
    <div
      className={clsx(
        classes.EditTask,
        "m-auto position-fixed",
        !displayVal && "d-none"
      )}
    >
      <div
        className={clsx(
          classes.editTask__bg,
          "w-100 h-100 position-absolute"
        )}
        onClick={closeTabFunc(false)}
      ></div>

      <div
        className={clsx(classes.editTask__container, "position-absolute")}
      >
        <form method="post" onSubmit={handleSubmit}>
          <div className="editTask__top d-flex w-100">
            <div className={clsx(classes.editTask__caption, "mr-auto")}>
              add Task
            </div>
            <div
              className="editTask__close-btn"
              onClick={closeTabFunc(false)}
            >
              <ion-icon name="close"></ion-icon>
            </div>
          </div>

          <div className={clsx(classes.editTask__group, "bar-title")}>
            <div className={clsx(classes.editTask__title)}>Title</div>
            <input
              type="text"
              placeholder="My Task"
              className="btn--outline w-100 py-3"
              style={{ fontSize: "1.6rem" }}
              name="title"
              value={values.title}
              onChange={handleChange}
            />
            {errors.name && (
              <div className={clsx(classes.editTask__err)}>
                *{errors.name}
              </div>
            )}
          </div>

          <div
            className={clsx(classes.editTask__buttons, "w-100 d-flex")}
          >
            <button
              className="editTask__button button btn--none-border btn--hover-bg-gray-light ml-auto mb-0"
              style={{ backgroundColor: "#3D3C50" }}
              type="submit"
            >
              Submit
            </button>
            <button
              type="reset"
              className="editTask__button button btn--none-border btn--hover-bg-gray mb-0"
              onClick={closeTabFunc()}
            >
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default EditTask;
